//import logo from './logo.svg';
import './App.css';

import { Button, Alert, Breadcrumb, Card } from 'react-bootstrap'


function App() {
  return (
    <div className="App">

      <header className="App-header">
        <Card>
          <Card.Img />
          <Card.Body>
            <Card.Title>
              Eric Website
            </Card.Title>
            <Card.Text>
              yeah you heard that right its a website im making it lets go
            </Card.Text>
          </Card.Body>
        </Card>
        <Breadcrumb>
          <Breadcrumb.Item>Item 1</Breadcrumb.Item>
          <Breadcrumb.Item>Item 2</Breadcrumb.Item>
          <Breadcrumb.Item>Item 3</Breadcrumb.Item>
        </Breadcrumb>
        <Alert variant="secondary">This is a button</Alert>
        <Button>Test Button 2</Button>

      </header>
    </div>
  );
}

export default App;
